INSERT INTO companies VALUES(445,'TMQ.TO','TRILOGY METALS',NULL,'explorer','510 Burrard Street, Vancouver, BC, Canada',NULL,NULL,NULL,'Trilogy Metals Inc. engages in the exploration and development of mineral properties in the United States. It primarily explores for copper, cobalt, lead, zinc, gold, and silver properties. The company principally holds interests in the Upper Kobuk mineral projects that include the Arctic, which contains polymetallic volcanogenic massive sulfide deposits; and Bornite that contains carbonate-hosted copper - cobalt deposits covering an area of approximately 448,217 acres located in the Ambler mining district in Northwest Alaska. The company was formerly known as NovaCopper Inc. and changed its name to Trilogy Metals Inc. in September 2016. Trilogy Metals Inc. was founded in 2004 and is headquartered in Vancouver, Canada.','2025-03-18T05:40:30.585Z');
