INSERT INTO companies VALUES(447,'TM.V','TRIGON METALS',NULL,'explorer','658 Lansdowne Avenue, Toronto, ON, Canada',NULL,NULL,NULL,'Trigon Metals Inc., together with its subsidiaries, engages in the acquisition, exploration, development, and maintenance of mines and mineral properties in the African continent. It primarily explores for copper, lead, and silver deposits. The company holds an 80% interest in its flagship project, the Kombat Mine Property, which consists of five mining licenses and two prospecting licenses located in Northern Namibia. The company was formerly known as Kombat Copper Inc. and changed its name to Trigon Metals Inc. in December 2016. Trigon Metals Inc. was incorporated in 2005 and is headquartered in Toronto, Canada.','2025-03-18T06:04:40.583Z');
INSERT INTO companies VALUES(448,'TORQ.V','TORQ RESOURCES',NULL,'explorer','1177 West Hastings Street, Vancouver, BC, Canada',NULL,NULL,NULL,'Torq Resources Inc., a junior exploration company, engages in the acquisition and exploration of mineral properties in the Americas. The company has an option to acquire 100% interests in the Margarita iron oxide-copper-gold project covering an area of approximately 1,045 hectares located in the city of Copiapo, Chile; Santa Cecilia gold-copper project, which covers an area of 3,250-hectares located in Chile. It has an option to acquire Andrea copper porphyry project located in northern Chile. The company was formerly known as Stratton Resources Inc. and changed its name to Torq Resources Inc. in March 2017. Torq Resources Inc. was founded in 1985 and is headquartered in Vancouver, Canada.','2025-03-18T06:04:40.583Z');
