INSERT INTO companies VALUES(457,'TWR.V','TOWER RESOURCES',NULL,'explorer','1112 West Pender St., Vancouver, BC, Canada',NULL,NULL,NULL,'Tower Resources Ltd. engages in the acquisition, evaluation, and exploration of mineral properties in Canada. The company primarily explores for gold, silver, and copper deposits. Its properties include the Rabbit North project that comprises 34 mineral tenures covering an area of 16,400 hectares located in the Kamloops mining division of British Columbia; the Nechako gold project, which includes 10 mineral tenures totaling 2,975 hectares situated in the Nechako Plateau Region of central British Columbia; and the More Creek project that consists of 5 mineral tenures totaling 6,430 hectares located in the Golden Triangle District of northwest British Columbia. The company was formerly known as Tower Energy Ltd. and changed its name to Tower Resources Ltd. in September 2011. The company was incorporated in 1988 and is headquartered in Vancouver, Canada.','2025-03-17T06:38:31.356Z');
INSERT INTO companies VALUES(458,'TXG.TO','TOREX GOLD RESOURCES',NULL,'explorer','Exchange Tower, Toronto, ON, Canada',NULL,NULL,NULL,'Torex Gold Resources Inc. operates as an intermediate gold producer. The company engages in the exploration, development, and operation of principal asset comprising 100% owned the Morelos Gold property, including Morelos Complex, which includes the El Limón Guajes Mine Complex; the Media Luna project, the EPO project, a processing plant, and related infrastructure that covers an area of approximately 29,000 hectares located southwest of Mexico City. It also mines for silver, copper, and carbon deposits. The company was formerly known as Gleichen Resources Ltd. and changed its name to Torex Gold Resources Inc. in April 2010. Torex Gold Resources Inc. was incorporated in 1980 and is based in Toronto, Canada.','2025-03-18T06:04:40.583Z');
INSERT INTO companies VALUES(459,'TUF.V','HONEY BADGER SILVER',NULL,'explorer','15782 Marine Drive, White Rock, BC, Canada',NULL,NULL,NULL,'Honey Badger Silver Inc. acquires, explores for, and develops mineral properties. It primarily explores for silver, cobalt, gold, zinc, and lead deposits. The company holds a 100% interest in the Clear Lake deposit that comprises 121 contiguous claims covering an area of approximately 2,500 hectares located in the Whitehorse Mining District of the Yukon; and Nanisivik project that covering an area of approximately 5,723 hectares located in Nunavut. In addition, it holds interest in the Plata, Groundhog, and Hy silver projects in southeast and south-central Yukon, Canada. Further, the company holds 100% interest in Sunrise Lake project comprising of six contiguous mining leases covering an area of 1,621 hectares located in Canada and Thunder Bay Silver project located in Ontario. Honey Badger Silver Inc. was incorporated in 1992 and is headquartered in White Rock, Canada.','2025-03-18T06:04:40.583Z');
INSERT INTO companies VALUES(460,'TSK.TO','TALISKER RESOURCES',NULL,'explorer','130 Adelaide Street West, Toronto, ON, Canada',NULL,NULL,NULL,'Talisker Resources Ltd., a junior resource company, explores and evaluates mineral properties in British Columbia, Canada. It primarily explores for gold and silver deposits. The company''s flagship project is the 100% owned Bralorne Gold Project comprising 63 mineral claims, three leases, and 197 Crown Grant claims covering an area of approximately 12,769.63 Ha. Talisker Resources Ltd. is headquartered in Toronto, Canada.','2025-03-18T06:04:40.583Z');
INSERT INTO companies VALUES(461,'USGD.CN','AMERICAN PACIFIC MINING',NULL,'explorer','510 Burrard Street, Vancouver, BC, Canada',NULL,NULL,NULL,'American Pacific Mining Corp. explores and develops precious and base metals in Western United States. The company explores for gold, silver, barite, zinc, and copper deposits. Its flagship properties are the Palmer Project located in Haines, Alaska; and the Madison Project located in Montana. The company was incorporated in 2017 and is headquartered in Vancouver, Canada.','2025-03-18T06:04:40.583Z');
INSERT INTO companies VALUES(462,'VAU.V','VIVA GOLD',NULL,'explorer','8047 199 Street, Langley, BC, Canada',NULL,NULL,NULL,'Viva Gold Corp. engages in the acquisition, exploration, and development of precious metal properties in the United States. It holds 100% interest in the Tonopah gold project comprising 508 unpatented mineral claims covering an area of approximately 10, 200 acres located in the Walker Lane Trend in Western Nevada. The company was formerly known as Aintree Resources Inc. Viva Gold Corp. was incorporated in 2009 and is based in Langley, Canada.','2025-03-18T06:04:40.583Z');
INSERT INTO companies VALUES(463,'VEIN.V','PASOFINO GOLD',NULL,'explorer','366 Bay Street, Toronto, ON, Canada',NULL,NULL,NULL,'Pasofino Gold Limited engages in the acquisition, exploration, and development of mineral properties. It has an option to acquire 49% interest in the Dugbe gold project covering an area of 2,559 square kilometers situated in southern Liberia. The company was formerly known as Enforcer Gold Corp. and changed its name to Pasofino Gold Limited in October 2019. Pasofino Gold Limited was incorporated in 2010 and is headquartered in Toronto, Canada.','2025-03-18T06:04:40.583Z');
